import React from "react";
import "./InputOption.css";

function InputOption({ Icon, title, color }) {
  return (
    <div className="InputOption">
      <div className="row">
        <div className="col-3">
          {" "}
          <Icon style={{ color: color }} />
        </div>
        <div className="col-3">
          <p className="icon__title">{title}</p>
        </div>
      </div>
    </div>
  );
}

export default InputOption;
